INSERT INTO AnimeEntry VALUES('clv76x2v7000bfz90jdmszah3','clv23qxzb000r1o8e6bmnbwwo',1,'https://cdn.myanimelist.net/images/anime/1015/138006l.jpg|https://myanimelist.net/anime/52991','Sousou no Frieren','TV Series','Fall 2023',1695945600000,1711065600000,NULL,'28 eps','PG-13','{"added":1713562582715,"started":null,"finished":null,"progress":{"1":{"completed":true,"finishDate":[1714550211237]},"2":{"completed":true,"finishDate":[1714550212564]},"3":{"completed":true,"finishDate":[1714550215286]},"4":{"completed":true,"finishDate":[1714555109525]},"5":{"completed":true,"finishDate":[1714557267845]}},"lastUpdated":1716561130153}','Adventure, Drama, Fantasy, Shounen','["Madhouse|https://myanimelist.net/anime/producer/11"]','Low',0,0,0,0,0,0,0,0,0,9.36999999999999921,0,replace('During their decade-long quest to defeat the Demon King, the members of the hero''s partyΓÇöHimmel himself, the priest Heiter, the dwarf warrior Eisen, and the elven mage FrierenΓÇöforge bonds through adventures and battles, creating unforgettable precious memories for most of them.\n\nHowever, the time that Frieren spends with her comrades is equivalent to merely a fraction of her life, which has lasted over a thousand years. When the party disbands after their victory, Frieren casually returns to her "usual" routine of collecting spells across the continent. Due to her different sense of time, she seemingly holds no strong feelings toward the experiences she went through.\n\nAs the years pass, Frieren gradually realizes how her days in the hero''s party truly impacted her. Witnessing the deaths of two of her former companions, Frieren begins to regret having taken their presence for granted; she vows to better understand humans and create real personal connections. Although the story of that once memorable journey has long ended, a new tale is about to begin.\n\n[Written by MAL Rewrite]','\n',char(10)),NULL);
INSERT INTO AnimeEntry VALUES('clv76xdzm000dfz905zlg694u','clv23qxzb000r1o8e6bmnbwwo',3,'https://cdn.myanimelist.net/images/anime/1711/142478l.jpg|https://myanimelist.net/anime/52701','Dungeon Meshi','TV Series','Winter 2024',1704326400000,NULL,'{"id":153518,"name":null,"overview":null,"releaseDate":"2024-06-13T13:29:58.401Z","episode":24,"season":null,"runtime":25,"image":"https://s4.anilist.co/file/anilistcdn/media/anime/cover/large/bx153518-LEK6pAXtI03D.jpg|https://myanimelist.net/anime/52701/52701/episode"}','24 eps','PG-13','{"added":1713562597134,"started":null,"finished":null,"progress":{"1":{"completed":true,"finishDate":[1714550248422]},"2":{"completed":true,"finishDate":[1714550249510]},"3":{"completed":true,"finishDate":[1714557268940]}},"lastUpdated":1717751489407}','Comedy, Fantasy, Gourmet, Seinen','["Trigger|https://myanimelist.net/anime/producer/803"]','Low',0,0,0,0,0,0,0,0,0,8.140000000000000569,0,replace('Adventuring knight Laios Touden leads a small party through a seemingly endless dungeon, a subterranean maze full of dangerous monsters and precarious traps. Through the use of advanced magic, an explorer can sometimes be resurrected, allowing them to learn from past mistakes and give traversing the dungeon another go. However, when a powerful dragon eats Falin, Laios'' spellcasting sister, she sends her brother and his companions back to the beginning to save them from permanent ends.\n\nThough strapped for cash and equipment, Laios resolves to fight his way through the dungeon and rescue Falin before she can be digested by the dragon. Despite some of Laios'' allies abandoning him, two remain by his side: elven mage Marcille Donato and halfling locksmith Chilchuck Tims. Due to their lack of funds, the party faces the daunting prospect of starving before being able to complete their quest. However, they find salvation in Senshi, a dwarven warrior with a penchant for cooking and safely eating defeated monsters.\n\nWith Senshi''s culinary expertise, Laios and his companions struggle through the dungeon while learning about gourmet diningΓÇöand each otherΓÇöalong the way.\n\n[Written by MAL Rewrite]','\n',char(10)),NULL);
INSERT INTO AnimeEntry VALUES('clv76xl1b000ffz901yk84t27','clv23qxzb000r1o8e6bmnbwwo',4,'https://cdn.myanimelist.net/images/anime/3/72078l.jpg|https://myanimelist.net/anime/28977','Gintama┬░','TV Series','Spring 2015',1428451200000,1459296000000,NULL,'51 eps','PG-13','{"added":1713562606265,"started":null,"finished":null,"progress":{"1":{"completed":true,"finishDate":[1714557270068]}},"lastUpdated":1716561130153}','Action, Comedy, Gag Humor, Historical, Parody, Samurai, Sci-Fi, Shounen','["Bandai Namco Pictures|https://myanimelist.net/anime/producer/1258"]','Low',0,0,0,0,0,0,0,0,0,9.060000000000000497,0,replace('Gintoki, Shinpachi, and Kagura return as the fun-loving but broke members of the Yorozuya team! Living in an alternate-reality Edo, where swords are prohibited and alien overlords have conquered Japan, they try to thrive on doing whatever work they can get their hands on. However, Shinpachi and Kagura still haven''t been paid... Does Gin-chan really spend all that cash playing pachinko?\n\nMeanwhile, when Gintoki drunkenly staggers home one night, an alien spaceship crashes nearby. A fatally injured crew member emerges from the ship and gives Gintoki a strange, clock-shaped device, warning him that it is incredibly powerful and must be safeguarded. Mistaking it for his alarm clock, Gintoki proceeds to smash the device the next morning and suddenly discovers that the world outside his apartment has come to a standstill. With Kagura and Shinpachi at his side, he sets off to get the device fixed; though, as usual, nothing is ever that simple for the Yorozuya team.\n\nFilled with tongue-in-cheek humor and moments of heartfelt emotion, Gintama''s fourth season finds Gintoki and his friends facing both their most hilarious misadventures and most dangerous crises yet.\n\n[Written by MAL Rewrite]','\n',char(10)),NULL);
INSERT INTO AnimeEntry VALUES('clv76xw9d000hfz909adtucxi','clv23qxzb000r1o8e6bmnbwwo',5,'https://cdn.myanimelist.net/images/anime/1208/94745l.jpg|https://myanimelist.net/anime/5114','Fullmetal Alchemist: Brotherhood','TV Series','Spring 2009',1238889600000,1278201600000,NULL,'64 eps','R','{"added":1713562620812,"started":null,"finished":null,"progress":null,"lastUpdated":1716561130154}','Action, Adventure, Drama, Fantasy, Military, Shounen','["Bones|https://myanimelist.net/anime/producer/4"]','Low',0,0,0,0,0,0,0,0,0,9.089999999999999858,0,replace('After a horrific alchemy experiment goes wrong in the Elric household, brothers Edward and Alphonse are left in a catastrophic new reality. Ignoring the alchemical principle banning human transmutation, the boys attempted to bring their recently deceased mother back to life. Instead, they suffered brutal personal loss: Alphonse''s body disintegrated while Edward lost a leg and then sacrificed an arm to keep Alphonse''s soul in the physical realm by binding it to a hulking suit of armor.\n\nThe brothers are rescued by their neighbor Pinako Rockbell and her granddaughter Winry. Known as a bio-mechanical engineering prodigy, Winry creates prosthetic limbs for Edward by utilizing "automail," a tough, versatile metal used in robots and combat armor. After years of training, the Elric brothers set off on a quest to restore their bodies by locating the Philosopher''s StoneΓÇöa powerful gem that allows an alchemist to defy the traditional laws of Equivalent Exchange.\n\nAs Edward becomes an infamous alchemist and gains the nickname "Fullmetal," the boys'' journey embroils them in a growing conspiracy that threatens the fate of the world.\n\n[Written by MAL Rewrite]','\n',char(10)),NULL);
INSERT INTO AnimeEntry VALUES('clv76y3aa000jfz90o9vs5dzn','clv23qxzb000r1o8e6bmnbwwo',6,'https://cdn.myanimelist.net/images/anime/9/7804l.jpg|https://myanimelist.net/anime/3588','Soul Eater','TV Series','Spring 2008',1207526400000,1238371200000,NULL,'51 eps','PG-13','{"added":1713562629917,"started":null,"finished":null,"progress":null,"lastUpdated":1716561130154}','Action, Comedy, Fantasy, School, Shounen','["Bones|https://myanimelist.net/anime/producer/4"]','Low',0,0,0,0,0,0,0,0,0,7.849999999999999645,0,replace('Death City is home to the famous Death Weapon Meister Academy, a technical academy headed by the ShinigamiΓÇöLord Death himself. Its mission: to raise "Death Scythes" for the Shinigami to wield against the many evils of their fantastical world. These Death Scythes, however, are not made from physical weapons; rather, they are born from human hybrids who have the ability to transform their bodies into Demon Weapons, and only after they have consumed the souls of 99 evil beings and one witch''s soul.\n\nSoul Eater Evans, a Demon Scythe who only seems to care about what''s cool, aims to become a Death Scythe with the help of his straight-laced wielder, or meister, Maka Albarn. The contrasting duo work and study alongside the hot headed BlackΓÿåStar and his caring weapon Tsubaki, as well as the Shinigami''s own son, Death the Kid, an obsessive-compulsive dual wielder of twin pistols Patty and Liz.\n\nSoul Eater follows these students of Shibusen as they take on missions to collect souls and protect the city from the world''s threats while working together under the snickering sun to become sounder in mind, body, and soul.\n\n[Written by MAL Rewrite]','\n',char(10)),NULL);
INSERT INTO AnimeEntry VALUES('clv76yalc000lfz904xqik1d6','clv23qxzb000r1o8e6bmnbwwo',7,'https://cdn.myanimelist.net/images/anime/7/76667l.jpg|https://myanimelist.net/anime/30279','Yuru Yuri SanΓÿåHai!','TV Series','Fall 2015',1444089600000,1450742400000,NULL,'12 eps','PG-13','{"added":1713562639387,"started":null,"finished":null,"progress":null,"lastUpdated":1716561130196}','CGDCT, Comedy, Gag Humor, Girls Love, School','["TYO Animations|https://myanimelist.net/anime/producer/333"]','Low',0,0,0,0,0,0,0,0,0,7.919999999999999929,0,replace('The members of the Amusement Club are back with more of Kyouko Toshinou''s antics, Chinatsu Yoshikawa''s schemes, Yui Funami''s retorts, and Akari Akaza''s small social presence as they strive to make each day as fun as the last! Whether the activity is an arm wrestling contest or making pancakes together, the group of entertainment-seekers are sure to give it their all.\n\nThe club members are often joined by their friends in the Student Council, who know how to have a good time as well. While it can get a little chaotic when all eight girls get together, it sure doesn''t stop them from meeting up and having fun!\n\n[Written by MAL Rewrite]','\n',char(10)),NULL);
INSERT INTO AnimeEntry VALUES('clw2z87l60003iut1d0n4tzrr','clv23qxzb000r1o8e6bmnbwwo',2,'https://cdn.myanimelist.net/images/anime/1370/140362l.jpg|https://myanimelist.net/anime/52588','Kaijuu 8-gou','TV Series','Spring 2024',1712966400000,NULL,'{"id":153288,"name":null,"overview":null,"releaseDate":"2024-06-15T14:00:01.084Z","episode":10,"season":null,"runtime":24,"image":"https://s4.anilist.co/file/anilistcdn/media/anime/cover/large/bx153288-tD2OmKy5CJab.jpg|https://myanimelist.net/anime/52588/52588/episode"}','12 eps','PG-13','{"added":1715484582756,"started":null,"finished":null,"progress":null,"lastUpdated":1717977629745}','Action, Adult Cast, Military, Sci-Fi, Shounen','["Production I.G|https://myanimelist.net/anime/producer/10"]','Low',0,0,0,0,0,0,0,0,0,8.259999999999999787,0,replace('After the destruction of their hometown, childhood friends Kafka Hibino and Mina Ashiro make a pact to become officers in the Defense ForceΓÇöa militarized organization tasked with protecting Japan from colossal monsters known as "kaijuu." Decades later, the 32-year-old Kafka has all but given up on his dreams of heroism. Instead, he cleans up the remains of the slaughtered kaijuu after they are defeated by valiant soldiersΓÇöincluding Mina, who has successfully achieved their shared goal.\n\nUpon meeting his new coworker, Reno Ichikawa, Kafka faces a mirror of his past self: an ambitious young man whose one desire is to fight as a member of the Defense Force. Unfortunately, the two are soon involved in a freak encounter with a rogue kaijuu. Though Kafka demonstrates his innate heroic nature and rescues Reno from certain doom, he is left gravely injured.\n\nWhile both men recover in a hospital, Kafka is seemingly attacked by another one of the beasts. As a result, he gains the ability to transform into a humanoid kaijuu with the strength and powers of the massive monsters menacing Japan. Dubbed "Kaijuu No. 8" by the military, Kafka resolves to use his newfound gifts for the greater good. Tied together by mutual respect, Kafka and Reno set out to join warriors like Mina at the forefront of the Defense Force.\n\n[Written by MAL Rewrite]','\n',char(10)),'');
INSERT INTO AnimeEntry VALUES('clw3ats6f00014bis57dd7q25','clv23qxzb000r1o8e6bmnbwwo',8,'https://cdn.myanimelist.net/images/anime/1244/138851l.jpg|https://myanimelist.net/anime/21','One Piece','TV Series','Fall 1999',940377600000,NULL,'{"id":21,"name":null,"overview":null,"releaseDate":"2024-06-16T00:30:01.382Z","episode":1109,"season":null,"runtime":24,"image":"https://s4.anilist.co/file/anilistcdn/media/anime/cover/large/bx21-YCDoj1EkAxFn.jpg|https://myanimelist.net/anime/21/21/episode"}','0 eps','PG-13','{"added":1715504064993,"started":null,"finished":null,"progress":null,"lastUpdated":1717977627012}','Action, Adventure, Fantasy, Shounen','["Toei Animation|https://myanimelist.net/anime/producer/18"]','Low',0,0,0,0,0,0,0,0,0,8.72000000000000064,0,replace('Barely surviving in a barrel after passing through a terrible whirlpool at sea, carefree Monkey D. Luffy ends up aboard a ship under attack by fearsome pirates. Despite being a naive-looking teenager, he is not to be underestimated. Unmatched in battle, Luffy is a pirate himself who resolutely pursues the coveted One Piece treasure and the King of the Pirates title that comes with it.\n\nThe late King of the Pirates, Gol D. Roger, stirred up the world before his death by disclosing the whereabouts of his hoard of riches and daring everyone to obtain it. Ever since then, countless powerful pirates have sailed dangerous seas for the prized One Piece only to never return. Although Luffy lacks a crew and a proper ship, he is endowed with a superhuman ability and an unbreakable spirit that make him not only a formidable adversary but also an inspiration to many.\n\nAs he faces numerous challenges with a big smile on his face, Luffy gathers one-of-a-kind companions to join him in his ambitious endeavor, together embracing perils and wonders on their once-in-a-lifetime adventure.\n\n[Written by MAL Rewrite]','\n',char(10)),'');
INSERT INTO AnimeEntry VALUES('clw3au5cm00034bisep7e5ae3','clv23qxzb000r1o8e6bmnbwwo',9,'https://cdn.myanimelist.net/images/anime/1216/142086l.jpg|https://myanimelist.net/anime/39894','Hibike! Euphonium 3','TV Series','Spring 2024',1712448000000,NULL,'{"id":109731,"name":null,"overview":null,"releaseDate":"2024-06-16T08:00:01.717Z","episode":11,"season":null,"runtime":25,"image":"https://s4.anilist.co/file/anilistcdn/media/anime/cover/large/bx109731-PBjrX9CebGus.png|https://myanimelist.net/anime/39894/39894/episode"}','13 eps','PG-13','{"added":1715504082064,"started":null,"finished":null,"progress":null,"lastUpdated":1718147224412}','Drama, Music, Performing Arts, School','["Kyoto Animation|https://myanimelist.net/anime/producer/2"]','Low',0,0,0,0,0,0,0,0,0,8.689999999999999503,0,replace('With the ensemble contest behind them, the members of the Kitauji High School concert band now aim to win a gold medal at the national competition. For third-year club president Kumiko Oumae and her friends, it is their last chance before graduation. Filled with anticipation and anxiety, Kumiko worries if she can successfully lead the band.\n\nAmid her struggles, Kumiko encounters transfer student Mayu Kuroe. From her gentle demeanor to her talented euphonium skills, Mayu was a member of the Seira Girls'' School concert bandΓÇöa regular at nationals. While Mayu is friendly, Kumiko cannot help but have an indescribable feeling from their meeting.\n\nAs new members arrive and plans are set in motion, the club, with an insatiable hunger for a gold medal, learns what it truly takes to propel themselves to reach the national level.\n\n[Written by MAL Rewrite]','\n',char(10)),'');
INSERT INTO AnimeEntry VALUES('clw3auhf800054bisw2f1n9v2','clv23qxzb000r1o8e6bmnbwwo',10,'https://cdn.myanimelist.net/images/anime/1758/141268l.jpg|https://myanimelist.net/anime/49458','Kono Subarashii Sekai ni Shukufuku wo! 3','TV Series','Spring 2024',1712707200000,NULL,'{"id":136804,"name":null,"overview":null,"releaseDate":"2024-06-12T13:59:59.055Z","episode":10,"season":null,"runtime":24,"image":"https://s4.anilist.co/file/anilistcdn/media/anime/cover/large/bx136804-7FVftG67FPBc.jpg|https://myanimelist.net/anime/49458/49458/episode"}','11 eps','PG-13','{"added":1715504097711,"started":null,"finished":null,"progress":null,"lastUpdated":1717704409058}','Adventure, Comedy, Fantasy, Isekai, Parody','["Drive|https://myanimelist.net/anime/producer/1967"]','Low',0,0,0,0,0,0,0,0,0,8.519999999999999574,0,'Third season of Kono Subarashii Sekai ni Shukufuku wo!','');
INSERT INTO AnimeEntry VALUES('clw3awyt500074bis02l41nsk','clv23qxzb000r1o8e6bmnbwwo',11,'https://cdn.myanimelist.net/images/anime/5/87048l.jpg|https://myanimelist.net/anime/32281','Kimi no Na wa.','Movie','Summer 2016',1472169600000,1472169600000,NULL,'1h 46m','PG-13','{"added":1715504213556,"started":null,"finished":null,"progress":null,"lastUpdated":1716561130282}','Award Winning, Drama, Romantic Subtext, Supernatural','["CoMix Wave Films|https://myanimelist.net/anime/producer/291"]','Low',0,0,0,0,0,0,0,0,0,8.839999999999999858,0,replace('Mitsuha Miyamizu, a high school girl, yearns to live the life of a boy in the bustling city of TokyoΓÇöa dream that stands in stark contrast to her present life in the countryside. Meanwhile in the city, Taki Tachibana lives a busy life as a high school student while juggling his part-time job and hopes for a future in architecture.\n\nOne day, Mitsuha awakens in a room that is not her own and suddenly finds herself living the dream life in TokyoΓÇöbut in Taki''s body! Elsewhere, Taki finds himself living Mitsuha''s life in the humble countryside. In pursuit of an answer to this strange phenomenon, they begin to search for one another.\n\nKimi no Na wa. revolves around Mitsuha and Taki''s actions, which begin to have a dramatic impact on each other''s lives, weaving them into a fabric held together by fate and circumstance.\n\n[Written by MAL Rewrite]','\n',char(10)),'');
INSERT INTO AnimeEntry VALUES('clw3ayam500094bishx03onqt','clv23qxzb000r1o8e6bmnbwwo',12,'https://cdn.myanimelist.net/images/anime/1183/141489l.jpg|https://myanimelist.net/anime/53770','Sentai Daishikkaku','TV Series','Spring 2024',1712448000000,NULL,'{"id":158417,"name":null,"overview":null,"releaseDate":"2024-06-16T07:30:01.220Z","episode":10,"season":null,"runtime":24,"image":"https://s4.anilist.co/file/anilistcdn/media/anime/cover/large/bx158417-2jUaUdiGBZQ8.jpg|https://myanimelist.net/anime/53770/53770/episode"}','12 eps','PG-13','{"added":1715504275513,"started":null,"finished":null,"progress":null,"lastUpdated":1718147224412}','Action, Sci-Fi, Shounen','["Yostar Pictures|https://myanimelist.net/anime/producer/2009"]','Low',0,0,0,0,0,0,0,0,0,7.639999999999999681,0,replace('Thirteen years ago, the Nefarious Monster Army invaded Earth, but humanity''s great protectors, the Dragon Keepers, defeated them in a single year! Every Sunday since, the monsters have been forced to act out humiliating defeat after defeat in front of the unsuspecting public. Determined to change this, a single monster, D, infiltrated the Ranger Force. With the help of the mysterious Ranger, Yumeko Suzukiri, D managed to seize one of the divine artifactsΓÇöthe only weapons capable of permanently killing the monsters'' immortal bodies! However, D''s subsequent encounter with the Dragon Keepers led to his unfortunate end, so who will stop them now...? \n\n(Source: Kodansha USA)','\n',char(10)),'');
INSERT INTO AnimeEntry VALUES('clw3ayqkp000b4bisuqv9p36x','clv23qxzb000r1o8e6bmnbwwo',13,'https://cdn.myanimelist.net/images/anime/1529/140306l.jpg|https://myanimelist.net/anime/54789','Boku no Hero Academia 7th Season','TV Series','Spring 2024',1714780800000,NULL,'{"id":163139,"name":null,"overview":null,"releaseDate":"2024-06-15T08:30:01.557Z","episode":7,"season":null,"runtime":24,"image":"https://s4.anilist.co/file/anilistcdn/media/anime/cover/large/bx163139-JchZhUFlNTWU.jpg|https://myanimelist.net/anime/54789/54789/episode"}','21 eps','PG-13','{"added":1715504296195,"started":null,"finished":null,"progress":null,"lastUpdated":1717977629746}','Action, School, Shounen, Super Power','["Bones|https://myanimelist.net/anime/producer/4"]','Low',0,0,0,0,0,0,0,0,0,8.039999999999999147,0,'Seventh season of Boku no Hero Academia.','');
INSERT INTO AnimeEntry VALUES('clw3b04o5000d4biszsyhoc18','clv23qxzb000r1o8e6bmnbwwo',14,'https://cdn.myanimelist.net/images/anime/1254/141155l.jpg|https://myanimelist.net/anime/55911','The Fable','TV Series','Spring 2024',1712448000000,NULL,'{"id":166910,"name":null,"overview":null,"releaseDate":"2024-06-15T15:55:01.972Z","episode":11,"season":null,"runtime":23,"image":"https://s4.anilist.co/file/anilistcdn/media/anime/cover/large/bx166910-pdgLmHMLdzUR.jpg|https://myanimelist.net/anime/55911/55911/episode"}','25 eps','PG-13','{"added":1715504361119,"started":null,"finished":null,"progress":null,"lastUpdated":1717977629864}','Adult Cast, Comedy, Organized Crime, Seinen','["Tezuka Productions|https://myanimelist.net/anime/producer/200"]','Low',0,0,0,0,0,0,0,0,0,7.049999999999999823,0,replace('Fable is a legendary hitman who has completed numerous jobs for a variety of clients. After concluding his latest assignment, the number of people he has recently killed becomes too high, and Fable is ordered by his boss to lay low for a year. He is suggested that having to adapt to life as an ordinary citizen might prove a valuable experience for his future work.\n\nFable is to be accompanied by the woman who acts as his driver, and the two will assume new identities as siblings. However, their boss warns them that they will both face a deadly punishment if Fable kills anyone during his time off. Thus begins Akira and Youko Satou''s joint one-year sabbatical from the underworld.\n\n[Written by MAL Rewrite]','\n',char(10)),'');
INSERT INTO AnimeEntry VALUES('clwkokei7000us2zk5oxnbc68','clwkojtw0000ss2zkus2ac70z',1,'https://cdn.myanimelist.net/images/anime/1015/138006l.webp|https://myanimelist.net/anime/52991','Sousou no Frieren','TV Series','Fall 2023',1695945600000,1711065600000,NULL,'28 eps','PG-13','{"added":1716555066986,"started":null,"finished":null,"progress":null,"lastUpdated":1716555066986}','Adventure, Drama, Fantasy, Shounen','["Madhouse|https://myanimelist.net/anime/producer/11"]','Low',0,0,0,0,0,0,0,0,0,9.36999999999999921,0,replace('During their decade-long quest to defeat the Demon King, the members of the hero''s partyΓÇöHimmel himself, the priest Heiter, the dwarf warrior Eisen, and the elven mage FrierenΓÇöforge bonds through adventures and battles, creating unforgettable precious memories for most of them.\n\nHowever, the time that Frieren spends with her comrades is equivalent to merely a fraction of her life, which has lasted over a thousand years. When the party disbands after their victory, Frieren casually returns to her "usual" routine of collecting spells across the continent. Due to her different sense of time, she seemingly holds no strong feelings toward the experiences she went through.\n\nAs the years pass, Frieren gradually realizes how her days in the hero''s party truly impacted her. Witnessing the deaths of two of her former companions, Frieren begins to regret having taken their presence for granted; she vows to better understand humans and create real personal connections. Although the story of that once memorable journey has long ended, a new tale is about to begin.\n\n[Written by MAL Rewrite]','\n',char(10)),'');
INSERT INTO AnimeEntry VALUES('clwkokmu5000ws2zkew93bhuj','clwkojtw0000ss2zkus2ac70z',2,'https://cdn.myanimelist.net/images/anime/1208/94745l.webp|https://myanimelist.net/anime/5114','Fullmetal Alchemist: Brotherhood','TV Series','Spring 2009',1238889600000,1278201600000,NULL,'64 eps','R','{"added":1716555077781,"started":null,"finished":null,"progress":null,"lastUpdated":1716555077781}','Action, Adventure, Drama, Fantasy, Military, Shounen','["Bones|https://myanimelist.net/anime/producer/4"]','Low',0,0,0,0,0,0,0,0,0,9.089999999999999858,0,replace('After a horrific alchemy experiment goes wrong in the Elric household, brothers Edward and Alphonse are left in a catastrophic new reality. Ignoring the alchemical principle banning human transmutation, the boys attempted to bring their recently deceased mother back to life. Instead, they suffered brutal personal loss: Alphonse''s body disintegrated while Edward lost a leg and then sacrificed an arm to keep Alphonse''s soul in the physical realm by binding it to a hulking suit of armor.\n\nThe brothers are rescued by their neighbor Pinako Rockbell and her granddaughter Winry. Known as a bio-mechanical engineering prodigy, Winry creates prosthetic limbs for Edward by utilizing "automail," a tough, versatile metal used in robots and combat armor. After years of training, the Elric brothers set off on a quest to restore their bodies by locating the Philosopher''s StoneΓÇöa powerful gem that allows an alchemist to defy the traditional laws of Equivalent Exchange.\n\nAs Edward becomes an infamous alchemist and gains the nickname "Fullmetal," the boys'' journey embroils them in a growing conspiracy that threatens the fate of the world.\n\n[Written by MAL Rewrite]','\n',char(10)),'');
INSERT INTO AnimeEntry VALUES('clwkoky72000ys2zkj0xiyjgf','clwkojtw0000ss2zkus2ac70z',3,'https://cdn.myanimelist.net/images/anime/1976/142016l.jpg|https://myanimelist.net/anime/820','Ginga Eiyuu Densetsu','OVA','Winter 1988',568598400000,858556800000,NULL,'110 eps','R','{"added":1716555092505,"started":null,"finished":null,"progress":null,"lastUpdated":1716555092505}','Adult Cast, Drama, Military, Sci-Fi, Space','["K-Factory|https://myanimelist.net/anime/producer/1269","Kitty Film Mitaka Studio|https://myanimelist.net/anime/producer/2256"]','Low',0,0,0,0,0,0,0,0,0,9.019999999999999574,0,replace('The 150-year-long stalemate between the two interstellar superpowers, the Galactic Empire and the Free Planets Alliance, comes to an end when a new generation of leaders arises: the idealistic military genius Reinhard von Lohengramm, and the FPA''s reserved historian, Yang Wenli.\n\nWhile Reinhard climbs the ranks of the Empire with the aid of his childhood friend, Siegfried Kircheis, he must fight not only the war, but also the remnants of the crumbling Goldenbaum Dynasty in order to free his sister from the Kaiser and unify humanity under one genuine ruler. Meanwhile, on the other side of the galaxy, YangΓÇöa strong supporter of democratic idealsΓÇöhas to stand firm in his beliefs, despite the struggles of the FPA, and show his pupil, Julian Mintz, that autocracy is not the solution.\n\nAs ideologies clash amidst the war''s many casualties, the two strategic masterminds must ask themselves what the real reason behind their battle is.\n\n[Written by MAL Rewrite]','\n',char(10)),'');
INSERT INTO LiveActionEntry VALUES('lliu8h2o','clv3nf68r0003kp76kaoty1sd',19,'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/lQPwNJ6DRpmRfTrKy8A94c7IvU3.jpg|https://www.themoviedb.org/tv/60585','Bosch','TV Series','2015',1421193600000,1624492800000,'null','68 eps','TV-MA','{"added":1713849752635,"started":null,"finished":null,"progress":null,"lastUpdated":1717707089482}','Mystery, Drama, Crime','English',0,0,0,0,4,5,0,4,0,7.889999999999999681,0,'Based on Michael Connelly''s best-selling novels, these are the stories of relentless LAPD homicide Detective Harry Bosch who pursues justice at all costs. But behind his tireless momentum is a man who is haunted by his past and struggles to remain loyal to his personal code: ΓÇ£Everybody counts or nobody counts.ΓÇ¥','null');
