INSERT INTO LiveActionEntry VALUES('sqzqdz5f','clv3nf68r0003kp76kaoty1sd',2,'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/oKIBhzZzDX07SoE2bOLhq2EE8rf.jpg|https://www.themoviedb.org/tv/62560','Mr. Robot','TV Series','2015',1435104000000,1576972800000,'null','45 eps','TV-MA','{"added":1713849752635,"started":null,"finished":null,"progress":{"1":{"completed":true,"finishDate":[1715040198319]},"2":{"completed":true,"finishDate":[1715315600508]},"3":{"completed":true,"finishDate":[1715315601852]},"4":{"completed":true,"finishDate":[1715315602856]},"5":{"completed":true,"finishDate":[1715408478643]},"6":{"completed":true,"finishDate":[1715408479635]}},"lastUpdated":1717707089291}','Crime, Drama','English',3,3,7,9,6,3,0,2,0,8.240000000000000213,0,'A contemporary and culturally resonant drama about a young programmer, Elliot, who suffers from a debilitating anti-social disorder and decides that he can only connect to people by hacking them. He wields his skills as a weapon to protect the people that he cares about. Elliot will find himself in the intersection between a cybersecurity firm he works for and the underworld organizations that are recruiting him to bring down corporate America.','null');
INSERT INTO LiveActionEntry VALUES('bkznsuks','clv3nf68r0003kp76kaoty1sd',7,'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/t6hqwD5oQRGgNrZKN71BQYxteC1.jpg|https://www.themoviedb.org/tv/95215','Reservation Dogs','TV Series','2021',1628467200000,1695772800000,'null','28 eps','TV-MA','{"added":1713849752635,"started":null,"finished":null,"progress":null,"lastUpdated":1717707089330}','Drama, Comedy','English',0,0,0,0,0,8,0,6.5,0,8.032000000000000028,0,'Four Indigenous teenagers in rural Oklahoma steal, rob and save in order to get to the exotic, mysterious and faraway land of California.','null');
INSERT INTO LiveActionEntry VALUES('cjf95wws','clv3nf68r0003kp76kaoty1sd',8,'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/ztuH5aJIZQpu5ci27tY2nx1gwjO.jpg|https://www.themoviedb.org/tv/1274','Six Feet Under','TV Series','2001',991526400000,1124582400000,'null','63 eps','TV-MA','{"added":1713849752635,"started":null,"finished":null,"progress":null,"lastUpdated":1717707089353}','Drama','English',0,0,0,0,0,6,0,6.700000000000000177,0,8.099999999999999645,0,'When death is your business, what is your life? For the Fisher family, the world outside of their family-owned funeral home continues to be at least as challenging asΓÇöand far less predictable thanΓÇöthe one inside.','null');
INSERT INTO LiveActionEntry VALUES('gkr8fv5n','clv3nf68r0003kp76kaoty1sd',11,'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/qIhsuhoIYR5yTnDta0IL4senbeN.jpg|https://www.themoviedb.org/tv/66573','The Good Place','TV Series','2016',1474243200000,1580342400000,'null','50 eps','NR','{"added":1713849752635,"started":null,"finished":null,"progress":null,"lastUpdated":1717707089372}','Sci-Fi & Fantasy, Comedy','English',0,0,0,0,0,8,0,6.400000000000000355,0,8,0,'Eleanor Shellstrop, an ordinary woman who, through an extraordinary string of events, enters the afterlife where she comes to realize that she hasn''t been a very good person. With the help of her wise afterlife mentor, she''s determined to shed her old way of living and discover the awesome (or at least the pretty good) person within.','null');
INSERT INTO LiveActionEntry VALUES('ctu9imcd','clv3nf68r0003kp76kaoty1sd',12,'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/hmmFST2bPU8EyqEb6IMALKajFAl.jpg|https://www.themoviedb.org/tv/93812','The Great','TV Series','2020',1589500800000,1683849600000,'null','30 eps','TV-MA','{"added":1713849752635,"started":null,"finished":null,"progress":{"1":{"completed":true,"finishDate":[1714600426106]},"2":{"completed":true,"finishDate":[1714600429627]}},"lastUpdated":1717707089380}','Drama, Comedy','English',7,7,7,7,8,8,0,6.799999999999999823,0,8.12100000000000044,0,'A genre-bending, anti-historical ride through 18th century Russia following the rise of Catherine the Nothing to Catherine the Great and her explosive relationship with husband Peter, the emperor of Russia.','null');
