INSERT INTO LiveActionEntry VALUES('owpsrmav','clv3nf68r0003kp76kaoty1sd',15,'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/ri8xr223xBb2TeHX3GKypvQPV2B.jpg|https://www.themoviedb.org/tv/54344','The Leftovers','TV Series','2014',1404000000000,1496534400000,'null','28 eps','TV-MA','{"added":1713849752635,"started":null,"finished":null,"progress":null,"lastUpdated":1717707089429}','Sci-Fi & Fantasy, Drama','English',0,0,0,0,0,0,0,0,0,7.607999999999999652,0,'When 2% of the world''s population abruptly disappears without explanation, the world struggles to understand just what they''re supposed to do about it. The drama series ''The Leftovers'' is the story of the people who didn''t make the cut.','null');
