INSERT INTO LiveActionEntry VALUES('ptxgv4c8','clv3nf68r0003kp76kaoty1sd',17,'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/rTc7ZXdroqjkKivFPvCPX0Ru7uw.jpg|https://www.themoviedb.org/tv/1398','The Sopranos','TV Series','1999',915926400000,1181433600000,'null','86 eps','TV-MA','{"added":1713849752635,"started":null,"finished":null,"progress":null,"lastUpdated":1717707089446}','Drama','English',0,0,0,0,7,5,0,6,0,8.641000000000000014,0,'The story of New Jersey-based Italian-American mobster Tony Soprano and the difficulties he faces as he tries to balance the conflicting requirements of his home life and the criminal organization he heads. Those difficulties are often highlighted through his ongoing professional relationship with psychiatrist Jennifer Melfi. The show features Tony''s family members and Mafia associates in prominent roles and story arcs, most notably his wife Carmela and his cousin and prot├⌐g├⌐ Christopher Moltisanti.','null');
INSERT INTO LiveActionEntry VALUES('02bssjob','clv3nf68r0003kp76kaoty1sd',18,'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/4lbclFySvugI51fwsyxBTOm4DqK.jpg|https://www.themoviedb.org/tv/1438','The Wire','TV Series','2002',1022976000000,1205020800000,'null','60 eps','TV-MA','{"added":1713849752635,"started":null,"finished":null,"progress":null,"lastUpdated":1717707089453}','Crime, Drama','English',0,0,0,0,0,5,0,0,0,8.599999999999999645,0,'Told from the points of view of both the Baltimore homicide and narcotics detectives and their targets, the series captures a universe in which the national war on drugs has become a permanent, self-sustaining bureaucracy, and distinctions between good and evil are routinely obliterated.','null');
INSERT INTO LiveActionEntry VALUES('oz3u9kl4','nv6jywem',1,'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/gycdE1ARByGQcK4fYR2mgpU6OO.jpg|https://www.themoviedb.org/movie/80','Before Sunset','Movie','2004',1087344000000,1087344000000,NULL,'1h 20m','R','{"added":1713561370958,"started":null,"finished":"2023-06-04T07:00:00.000Z","progress":null,"lastUpdated":1713568575500}','Drama, Romance','English',6,10,5,7,9,10,0,10,0,7.799999999999999823,0,'Nine years later, Jesse travels across Europe giving readings from a book he wrote about the night he spent in Vienna with Celine. After his reading in Paris, Celine finds him, and they spend part of the day together before Jesse has to again leave for a flight. They are both in relationships now, and Jesse has a son, but as their strong feelings for each other start to return, both confess a longing for more.','null');
