INSERT INTO LiveActionEntry VALUES('clwkogjgg0009s2zkuoj8h4m4','clwknzmu30001s2zk9r0b6so6',3,'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/z1p34vh7dEOnLDmyCrlUVLuoDzd.jpg|https://www.themoviedb.org/movie/823464','Godzilla x Kong: The New Empire','Movie','2024',1711497600000,1711497600000,'null','1h 55m','PG-13','{"added":1716554886779,"started":null,"finished":null,"progress":null,"lastUpdated":1716554886779}','Science Fiction, Action, Adventure','English',0,0,0,0,0,0,0,0,0,7.25,0,'Following their explosive showdown, Godzilla and Kong must reunite against a colossal undiscovered threat hidden within our world, challenging their very existence ΓÇô and our own.','');
INSERT INTO LiveActionEntry VALUES('clwkogsjq000bs2zkievkbj5r','clwknzmu30001s2zk9r0b6so6',3,'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/iADOJ8Zymht2JPMoy3R7xceZprc.jpg|https://www.themoviedb.org/movie/786892','Furiosa: A Mad Max Saga','Movie','2024',1716336000000,1716336000000,'null','2h 29m','R','{"added":1716554898561,"started":null,"finished":null,"progress":null,"lastUpdated":1716554898561}','Science Fiction, Action, Adventure','English',0,0,0,0,0,0,0,0,0,7.599999999999999645,0,'As the world fell, young Furiosa is snatched from the Green Place of Many Mothers and falls into the hands of a great Biker Horde led by the Warlord Dementus. Sweeping through the Wasteland they come across the Citadel presided over by The Immortan Joe. While the two Tyrants war for dominance, Furiosa must survive many trials as she puts together the means to find her way home.','');
INSERT INTO LiveActionEntry VALUES('clwkogyxx000ds2zk08m8kpad','clwknzmu30001s2zk9r0b6so6',5,'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/hkxxMIGaiCTmrEArK7J56JTKUlB.jpg|https://www.themoviedb.org/movie/940721','Godzilla Minus One','Movie','2023',1698969600000,1698969600000,'null','2h 5m','PG-13','{"added":1716554906849,"started":null,"finished":null,"progress":null,"lastUpdated":1716554906849}','Science Fiction, Horror, Action','Japanese',0,0,0,0,0,0,0,0,0,7.682000000000000383,0,'Postwar Japan is at its lowest point when a new crisis emerges in the form of a giant monster, baptized in the horrific power of the atomic bomb.','');
INSERT INTO LiveActionEntry VALUES('clwkohcip000fs2zkex6fawq1','clwknzmu30001s2zk9r0b6so6',6,'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/maBJkaBM4UqAttn9UkLCfZEVEfk.jpg|https://www.themoviedb.org/tv/62649','Superstore','TV Series','2015',1448841600000,1616630400000,'null','113 eps','TV-14','{"added":1716554924444,"started":null,"finished":null,"progress":null,"lastUpdated":1716554924444}','Comedy','English',0,0,0,0,0,0,0,0,0,7.578999999999999738,0,'A hilarious workplace comedy about a unique family of employees at a super-sized mega store. From the bright-eyed newbies and the seen-it-all veterans to the clueless summer hires and the in-it-for-life managers, together they hilariously tackle the day-to-day grind of rabid bargain hunters, riot-causing sales and nap-worthy training sessions.','');
INSERT INTO LiveActionEntry VALUES('clwkohnff000hs2zkbxvzwl1i','clwknzmu30001s2zk9r0b6so6',7,'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/gNS5tRSG3UlXodCxznKKOKweqxh.jpg|https://www.themoviedb.org/tv/1855','Star Trek: Voyager','TV Series','1995',790214400000,990576000000,'null','169 eps','TV-PG','{"added":1716554938583,"started":null,"finished":null,"progress":null,"lastUpdated":1716554938583}','Sci-Fi & Fantasy, Drama, Action & Adventure','English',0,0,0,0,0,0,0,0,0,7.799999999999999823,0,'Pulled to the far side of the galaxy, where the Federation is 75 years away at maximum warp speed, a Starfleet ship must cooperate with Maquis rebels to find a way home.','');
INSERT INTO LiveActionEntry VALUES('clwkoi451000js2zkzsephb3d','clwknzmu30001s2zk9r0b6so6',8,'https://www.themoviedb.org/t/p/w600_and_h900_bestv2/6rhuM3oMoEWKxAdrm7IyM8oq8cC.jpg|https://www.themoviedb.org/tv/918','M*A*S*H','TV Series','1972',85536000000,415238400000,'null','251 eps','TV-PG','{"added":1716554960241,"started":null,"finished":null,"progress":null,"lastUpdated":1716554960241}','War & Politics, Drama, Comedy','English',0,0,0,0,0,0,0,0,0,7.894000000000000127,0,'The 4077th Mobile Army Surgical Hospital is stuck in the middle of the Korean war. With little help from the circumstances they find themselves in, they are forced to make their own fun. Fond of practical jokes and revenge, the doctors, nurses, administrators, and soldiers often find ways of making wartime life bearable.','');
INSERT INTO MangaEntry VALUES('clv76vkcf0001fz90kur6sx3g','clv5rqqqo00017n1pmqyu922m',1,'https://cdn.myanimelist.net/images/manga/2/292663l.jpg|https://myanimelist.net/manga/164790','Green Green Greens','Manga','2023',NULL,NULL,NULL,'0','0','{"added":1713562572527,"started":null,"finished":null,"progress":{"chapter":{"1":{"completed":true,"finishDate":[1714556090451]},"2":{"completed":true,"finishDate":[1714556126589]}},"volume":{"1":{"completed":true,"finishDate":[1714556128920]},"2":{"completed":true,"finishDate":[1714556130376]},"3":{"completed":true,"finishDate":[1714556131625]}}},"lastUpdated":1716561628102}','School, Shounen, Sports','["Shounen Jump (Weekly)|https://myanimelist.net/manga/magazine/83"]','["Kento Terasaka (Story & Art)|https://myanimelist.net/people/47932"]','Low',0,0,0,0,0,0,0,7.030000000000000248,0,replace('Haku Yaesaki is a bored high school student with no direction in life. Right as he starts noticing how all his friends have dreams they are striving for, he meets pro golfer hopeful Nadeshiko Oga and his empty life begins to change. Now, it''s time to find a whole new you as this golfing adventure tees off!\n\n(Source: MANGA Plus)','\n',char(10)),NULL);
INSERT INTO MangaEntry VALUES('clv76vszz0003fz90ofuxb3c4','clv5rqqqo00017n1pmqyu922m',2,'https://cdn.myanimelist.net/images/manga/3/289662l.jpg|https://myanimelist.net/manga/159722','Asumi Kakeru','Manga','2023',NULL,NULL,NULL,'0','4','{"added":1713562572527,"started":null,"finished":null,"progress":{"chapter":{"1":{"completed":true,"finishDate":[1714557261109]},"2":{"completed":true,"finishDate":[1714557262228]}},"volume":{"1":{"completed":true,"finishDate":[1714557263377]}}},"lastUpdated":1716561628103}','Combat Sports, Shounen, Sports','["Shounen Jump (Weekly)|https://myanimelist.net/manga/magazine/83"]','[" Kawada (Story & Art)|https://myanimelist.net/people/34091"]','Low',0,0,0,0,0,0,0,6.839999999999999858,0,replace('Nito is living a quiet high school life while taking care of his disabled grandpa, but thanks to an encounter with a schoolmate striving to be a pro female MMA fighter, his life is about to flip. Sometimes, you just have to fight! This serious MMA story is an all-out battle!\n\n(Source: MANGA Plus)','\n',char(10)),NULL);
INSERT INTO MangaEntry VALUES('clv76wf8r0005fz90c2o2nyqk','clv5rqqqo00017n1pmqyu922m',3,'https://cdn.myanimelist.net/images/manga/1/260530l.jpg|https://myanimelist.net/manga/1183','Cross Game','Manga','2005',NULL,NULL,NULL,'170','17','{"added":1713562572527,"started":null,"finished":null,"progress":{"chapter":{"1":{"completed":true,"finishDate":[1714557264534]}}},"lastUpdated":1716561628103}','Award Winning, Comedy, Drama, Romance, School, Shounen, Sports, Team Sports','["Shounen Sunday|https://myanimelist.net/manga/magazine/229"]','["Mitsuru Adachi (Story & Art)|https://myanimelist.net/people/2104"]','Low',0,0,0,0,0,0,0,8.480000000000000426,0,replace('Kou Kitamura is a fifth grader whose family runs a sporting goods store. One of the regular customers of his family''s store is the Tsukishima Batting Center, and so he gets to know the four daughters of the Tsukishima family (Ichiyo, Wakaba, Aoba, and Momiji) very well. Since Kou has spent so much time practicing in their batting cages, he has become a genius hitter, but has no knowledge of any other aspect of baseball. This is in contrast to Aoba, who, despite being a year younger, is an adept pitcher and hitter. Wakaba is a classmate of Kou''s, and she seems fully intent on marrying him when she grows up. All seems idyllic in their world, until tragedy strikes. The story then skips ahead to four years later, as Kou has continued the training he began four years ago, but has not played in a baseball game since. As he finally begins playing again, it remains to be seen whether or not he will live up to the expectations of those who know the true talent he has been hiding all this time.\n\n(Source: ANN)','\n',char(10)),NULL);
INSERT INTO MangaEntry VALUES('clv76wnd50007fz908ptgl3dd','clv5rqqqo00017n1pmqyu922m',4,'https://cdn.myanimelist.net/images/manga/3/210341l.jpg|https://myanimelist.net/manga/113138','Jujutsu Kaisen','Manga','2018',NULL,NULL,NULL,'0','0','{"added":1713562572527,"started":null,"finished":null,"progress":null,"lastUpdated":1716561628103}','Action, School, Shounen, Supernatural','["Shounen Jump (Weekly)|https://myanimelist.net/manga/magazine/83"]','["Gege Akutami (Story & Art)|https://myanimelist.net/people/47924"]','Low',0,0,0,0,0,0,0,8.519999999999999574,0,replace('Hidden in plain sight, an age-old conflict rages on. Supernatural monsters known as "Curses" terrorize humanity from the shadows, and powerful humans known as "Jujutsu" sorcerers use mystical arts to exterminate them. When high school student Yuuji Itadori finds a dried-up finger of the legendary Curse Sukuna Ryoumen, he suddenly finds himself joining this bloody conflict.\n\nAttacked by a Curse attracted to the finger''s power, Yuuji makes a reckless decision to protect himself, gaining the power to combat Curses in the process but also unwittingly unleashing the malicious Sukuna into the world once more. Though Yuuji can control and confine Sukuna to his own body, the Jujutsu world classifies Yuuji as a dangerous, high-level Curse who must be exterminated.\n\nDetained and sentenced to death, Yuuji meets Satoru GojouΓÇöa teacher at Jujutsu High SchoolΓÇöwho explains that despite his imminent execution, there is an alternative for him. Being a rare vessel to Sukuna, if Yuuji were to die, then Sukuna would perish too. Therefore, if Yuuji were to consume the many other remnants of Sukuna, then Yuuji''s subsequent execution would truly eradicate the malicious demon. Taking up this chance to make the world safer and live his life for a little longer, Yuuji enrolls in Tokyo Prefectural Jujutsu High School, jumping headfirst into a harsh and unforgiving battlefield.\n\n[Written by MAL Rewrite]','\n',char(10)),NULL);
INSERT INTO MangaEntry VALUES('clv76wv050009fz90fxrmnmxm','clv5rqqqo00017n1pmqyu922m',5,'https://cdn.myanimelist.net/images/manga/2/253146l.jpg|https://myanimelist.net/manga/13','One Piece','Manga','1997',NULL,NULL,NULL,'0','0','{"added":1713562572527,"started":null,"finished":null,"progress":null,"lastUpdated":1716561628103}','Action, Adventure, Fantasy, Shounen','["Shounen Jump (Weekly)|https://myanimelist.net/manga/magazine/83"]','["Eiichiro Oda (Story & Art)|https://myanimelist.net/people/1881"]','Low',0,0,0,0,0,0,0,9.22000000000000064,0,replace('Gol D. Roger, a man referred to as the "King of the Pirates," is set to be executed by the World Government. But just before his demise, he confirms the existence of a great treasure, One Piece, located somewhere within the vast ocean known as the Grand Line. Announcing that One Piece can be claimed by anyone worthy enough to reach it, the King of the Pirates is executed and the Great Age of Pirates begins.\n\nTwenty-two years later, a young man by the name of Monkey D. Luffy is ready to embark on his own adventure, searching for One Piece and striving to become the new King of the Pirates. Armed with just a straw hat, a small boat, and an elastic body, he sets out on a fantastic journey to gather his own crew and a worthy ship that will take them across the Grand Line to claim the greatest status on the high seas.\n\n[Written by MAL Rewrite]','\n',char(10)),NULL);
INSERT INTO MangaEntry VALUES('clwkop8tk0019s2zkqrg4xchf','clwkoosav0017s2zk2slg9q0n',1,'https://cdn.myanimelist.net/images/manga/1/157897l.jpg|https://myanimelist.net/manga/2','Berserk','Manga','1989',NULL,NULL,NULL,'0','0','{"added":1716555292899,"started":null,"finished":null,"progress":{"volume":{"0":{"completed":true,"finishDate":[1716557803283]},"1":{"completed":true,"finishDate":[1716556133782]},"2":{"completed":true,"finishDate":[1716557040220]},"3":{"completed":true,"finishDate":[1716557041778]},"4":{"completed":true,"finishDate":[1716557367345]},"5":{"completed":true,"finishDate":[1716557376194]},"6":{"completed":true,"finishDate":[1716557788617]},"10":{"completed":true,"finishDate":[1716557842293]}},"chapter":{"0":{"completed":true,"finishDate":[1716557036424,1716557387636,1716557480543,1716557501981,1716557546042,1716557593349,1716557596231,1716557612696,1716557627970,1716557716831,1716557764180,1716557871749,1716558672790,1716558675083,1716558773559]},"1":{"completed":true,"finishDate":[1716558828039]}}},"lastUpdated":1716560861560}','Action, Adventure, Award Winning, Drama, Fantasy, Gore, Horror, Military, Mythology, Psychological, Seinen, Supernatural','["Young Animal|https://myanimelist.net/manga/magazine/2"]','["Kentarou Miura (Story & Art)|https://myanimelist.net/people/1868"," Studio Gaga (Art)|https://myanimelist.net/people/49592"]','Low',0,0,0,0,0,0,0,9.47000000000000063,0,replace('Guts, a former mercenary now known as the "Black Swordsman," is out for revenge. After a tumultuous childhood, he finally finds someone he respects and believes he can trust, only to have everything fall apart when this person takes away everything important to Guts for the purpose of fulfilling his own desires. Now marked for death, Guts becomes condemned to a fate in which he is relentlessly pursued by demonic beings.\n\nSetting out on a dreadful quest riddled with misfortune, Guts, armed with a massive sword and monstrous strength, will let nothing stop him, not even death itself, until he is finally able to take the head of the one who stripped himΓÇöand his loved oneΓÇöof their humanity.\n\n[Written by MAL Rewrite]\n\nIncluded one-shot:\nVolume 14: Berserk: The Prototype','\n',char(10)),'');
INSERT INTO MangaEntry VALUES('clwkpahxo001ds2zkhsz1z5ts','clwkoosav0017s2zk2slg9q0n',3,'https://cdn.myanimelist.net/images/manga/1/259070l.jpg|https://myanimelist.net/manga/656','Vagabond','Manga','1998',NULL,NULL,NULL,'10','37','{"added":1716556284487,"started":null,"finished":null,"progress":{"chapter":{"0":{"completed":true,"finishDate":[1716556309879,1716556703588,1716556768380,1716556930470,1716556955876,1716557207407]},"1":{"completed":true,"finishDate":[1716558790474]},"2":{"completed":true,"finishDate":[1716559440500]},"3":{"completed":true,"finishDate":[1716559450904]}},"volume":{"10":{"completed":true,"finishDate":[1716556677558]},"11":{"completed":true,"finishDate":[1716556781234]},"12":{"completed":true,"finishDate":[1716556791914]}}},"lastUpdated":1716560861572}','Action, Adventure, Award Winning, Historical, Samurai, Seinen','["Morning|https://myanimelist.net/manga/magazine/72"]','["Takehiko Inoue (Story & Art)|https://myanimelist.net/people/1911","Eiji Yoshikawa (Story)|https://myanimelist.net/people/5760"]','Low',0,0,0,0,0,0,0,9.25,0,replace('In 16th-century Japan, Shinmen Takezou is a wild, rough young man, in both his appearance and his actions. His aggressive nature has won him the collective reproach and fear of his village, leading him and his best friend, Matahachi Honiden, to run away in search of something grander than provincial life. The pair enlist in the Toyotomi army, yearning for gloryΓÇöbut when the Toyotomi suffer a crushing defeat at the hands of the Tokugawa Clan at the Battle of Sekigahara, the friends barely make it out alive.\n\nAfter the two are separated, Shinmen returns home on a self-appointed mission to notify the Hon''iden family of Matahachi''s survival. He instead finds himself a wanted criminal, framed for his friend''s supposed murder based on his history of violence. Upon being captured, he is strung up on a tree and left to die. An itinerant monk, the distinguished Takuan Soho, takes pity on the "devil child," secretly freeing Shinmen and christening him with a new name to avoid pursuit by the authorities: Musashi Miyamoto.\n\nVagabond is the fictitious retelling of the life of one of Japan''s most renowned swordsmen, the "Sword Saint" Musashi MiyamotoΓÇöhis rise from a swordsman with no desire other than to become "Invincible Under the Heavens" to an enlightened warrior who slowly learns of the importance of close friends, self-reflection, and life itself.\n\n[Written by MAL Rewrite]','\n',char(10)),'');
INSERT INTO MangaEntry VALUES('clwkrvt6l0025s2zk1yhrv0uy','clwkoosav0017s2zk2slg9q0n',5,'https://cdn.myanimelist.net/images/manga/3/266834l.webp|https://myanimelist.net/manga/4632','Oyasumi Punpun','Manga','2007',NULL,NULL,NULL,'147','13','{"added":1716560638073,"started":null,"finished":null,"progress":null,"lastUpdated":1716560861574}','Drama, Psychological, Seinen, Slice of Life','["Big Comic Spirits|https://myanimelist.net/manga/magazine/3"]','["Inio Asano (Story & Art)|https://myanimelist.net/people/2836"]','Low',0,0,0,0,0,0,0,9.009999999999999787,0,replace('Punpun Onodera is a normal 11-year-old boy living in Japan. Hopelessly idealistic and romantic, Punpun begins to see his life take a subtleΓÇöthough nonetheless startlingΓÇöturn to the adult when he meets the new girl in his class, Aiko Tanaka. It is then that the quiet boy learns just how fickle maintaining a relationship can be, and the surmounting difficulties of transitioning from a na├»ve boyhood to a convoluted adulthood. When his father assaults his mother one night, Punpun realizes another thing: those whom he looked up to were not as impressive as he once thought.\n\nAs his problems increase, Punpun''s once shy demeanor turns into voluntary reclusiveness. Rather than curing him of his problems and conflicting emotions, this merely intensifies them, sending him down the dark path of maturity in this grim coming-of-age saga.\n\n[Written by MAL Rewrite]','\n',char(10)),'');
INSERT INTO MangaEntry VALUES('clwkrw1b70027s2zkpjxuz730','clwkoosav0017s2zk2slg9q0n',4,'https://cdn.myanimelist.net/images/manga/2/166124l.webp|https://myanimelist.net/manga/70345','Grand Blue','Manga','2014',NULL,NULL,NULL,'0','0','{"added":1716560648607,"started":null,"finished":null,"progress":null,"lastUpdated":1716560861567}','Comedy, Seinen','["good! Afternoon|https://myanimelist.net/manga/magazine/316"]','["Kenji Inoue (Story)|https://myanimelist.net/people/7108","Kimitake Yoshioka (Art)|https://myanimelist.net/people/16441"]','Low',0,0,0,0,0,0,0,9.02999999999999936,0,replace('Among the seaside town of Izu''s ocean waves and rays of shining sun, Iori Kitahara is just beginning his freshman year at Izu University. As he moves into his uncle''s scuba diving shop, Grand Blue, he eagerly anticipates his dream college life, filled with beautiful girls and good friends.\n\nBut things don''t exactly go according to plan. Upon entering the shop, he encounters a group of rowdy, naked upperclassmen, who immediately coerce him into participating in their alcoholic activities. Though unwilling at first, Iori quickly gives in and becomes the heart and soul of the party. Unfortunately, this earns him the scorn of his cousin, Chisa Kotegawa, who walks in at precisely the wrong time. Undeterred, Iori still vows to realize his ideal college life, but will things go according to plan this time, or will his situation take yet another dive?\n\n[Written by MAL Rewrite]','\n',char(10)),'');
